import './admin.css'
import Header from './../../components/header/Header'
import Footer from '../../components/footer/Footer'
import React, { useContext } from "react";
import { CartContext } from '../../components/Context';

    const Admin = () => {
        const { addProduct, updateProduct, deleteProduct } = useContext(CartContext);

        const testProduct = {
          category: 'Акустическая гитара',
          title: "Новый продукт",
          price: 100,
          imageUrl: "https://via.placeholder.com/150",
        };
        return (
            <>
            <Header />
            <section className='admin'>
            <div className="container">
            <h1>Тестирование CRUD операций</h1>
      <button onClick={() => addProduct(testProduct)}>Добавить продукт</button>
      <button onClick={() => updateProduct(1, { title: "Обновленный продукт", price: 150 })}>
        Обновить продукт с ID 1
      </button>
      <button onClick={() => deleteProduct(1)}>Удалить продукт с ID 1</button>
            </div>
            </section>
            <Footer />
            </>
        )
    }

    export default Admin;
